import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './JS/Dashboard';
import HomePage from './JS/HomePage';
import AccountPage from './JS/AccountPage';
import AccidentReport from './JS/AccidentReport';
import PolicyPage from './JS/PolicyPage';
import 'bootstrap/dist/css/bootstrap.min.css';
import AdminDashboard from './JS/AdminDashboard';
import AdminView from './JS/AdminView';
import UserReportView from './JS/UserReportView';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<LoginPage />} />
//         <Route path="/signup" element={<SignupPage />} />
//         <Route path="/forgot-password" element={<ForgotPassword />} />
        <Route path="/" element={<HomePage />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/account" element={<AccountPage />} />
        <Route path="/report-accident" element={<AccidentReport />} />
        <Route path="/policy" element={<PolicyPage />} />
        <Route path="/admin" element={<AdminDashboard />} />
        <Route path="/admin-view" element={<AdminView />} />
        <Route path="/user-view" element={<UserReportView />} />
      </Routes>
    </Router>
  );
}

export default App;
